  false,\n\t\"url\": null,\n\t\"notes\": \"Bathymetric terrain models (BTMs) of seafloor
  morphology are an important component of marine geological investigations. Advances
  in technologies of acquiring and processing bathymetric data have facilitated the
  creation of high-resolution bathymetric surfaces that approach the resolution of
  those available for onshore investigations. These bathymetric terrain models provide
  a detailed representation of the Earth's subaqueous surface and when combined with
  other geophysical and geologic datasets, allow for interpretation of modern and
  ancient geologic processes. More information about the individual USGS source surveys
  (if USGS scientists participated in survey) for this grid can be found on the Woods
  Hole Coastal and Marine Science Center Field Activity webpage: 2002-051-FA: http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2002-051-FA
